        <ScrollStyle>
            <div className="movil">
                <div data-aos="fade-in" data-aos-duration="1000" className=" scroll box1"></div>
                <div data-aos="fade-in" data-aos-duration="1200"className=" scroll box2"></div>
                <div data-aos="fade-in" data-aos-duration="1300"className=" scroll box3"></div>
                <div data-aos="fade-in" data-aos-duration="1400"className=" scroll box4"></div>
            </div>
            <div className="pc">
                <div className=" scroll box1"></div>
                <div className=" scroll box2"></div>
                <div className=" scroll box3"></div>
                <div className=" scroll box4"></div>
                <div className=" scroll box5"></div>
                <div className=" scroll box6"></div>
            </div>

        </ScrollStyle>
    )

}

export default Scroll;
